import React from 'react';
import { 
    Timeline, 
    TimelineItem, 
    TimelineSeparator, 
    TimelineDot, 
    TimelineConnector, 
    TimelineContent 
  } from '@mui/lab';

  // import TimelineOppositeContent, {
  //   timelineOppositeContentClasses,
  // } from '@mui/lab/TimelineOppositeContent';

  import { timelineContentClasses } from '@mui/lab/TimelineContent';
  import TimelineOppositeContent from '@mui/lab/TimelineOppositeContent';


const Experience = () => {
  return (
    <Timeline
    // sx={{
    //   [`& .${timelineContentClasses.root}`]: {
    //     flex: 0.2,
    //   },
    // }}
    >
      <TimelineItem>
      <TimelineOppositeContent color="textSecondary">
          June 2023 - August 2023
        </TimelineOppositeContent>
        <TimelineSeparator>
          <TimelineDot />
          <TimelineConnector />
        </TimelineSeparator>
        <TimelineContent>
          <h>Kumon</h>
          <p>Math and English Tutor</p>
        </TimelineContent>
      </TimelineItem>
      <TimelineItem>
      <TimelineOppositeContent color="textSecondary">
          09:30 am
        </TimelineOppositeContent>
        <TimelineSeparator>
          <TimelineDot />
          <TimelineConnector />
        </TimelineSeparator>
        <TimelineContent>Code</TimelineContent>
      </TimelineItem>
      <TimelineItem>
      <TimelineOppositeContent color="textSecondary">
          09:30 am
        </TimelineOppositeContent>
        <TimelineSeparator>
          <TimelineDot />
        </TimelineSeparator>
        <TimelineContent>Sleep</TimelineContent>
      </TimelineItem>
    </Timeline>
  );
};

export default Experience;



